import React from "react";
import Footer from "./components/Footer";
import Header from "./components/Header";
import Content from "./components/Content";
import TextField from '@material-ui/core/TextField';
import Dialog from '@material-ui/core/TextField';

export function App() {

    const [open, setOpen] = React.useState(false);
    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    return (
        <div className="wrapper">
            <Header />
            <Content />
            <div className='RecordButton' onClick={handleClickOpen}>
                <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
                    <DialogTitle id="form-dialog-title">Записаться на приём</DialogTitle>
                    <DialogContet>
                        <DialogContetText>Log in</DialogContetText>
                        <TextField
                            autoFocus
                            margin="dense"
                            id="name"
                            label="Email Adress"
                            type="email"
                            fullWidth />
                        <TextField
                            autoFocus
                            margin="dense"
                            id="pass"
                            label="Password"
                            type="password"
                            fullWidth />
                    </DialogContet>
                    <DialogActions>
                        <Button onClick={handleClose} color="primary">Cancel</Button>
                        <Button onClick={handleClose} color="primary">Log in</Button>
                    </DialogActions>
                </Dialog>
                <div>
                    Записаться на приём
                </div>
            </div>
            />
            <Footer />

        </div>
    );
}
